import React, { useEffect, useState } from "react";
import AxiosAuth from "path/to/AxiosAuth"; // Replace with the correct path
import Config from "path/to/Config"; // Replace with the correct path

const HomeList = () => {
  const [homes, setHomes] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await search({});
      setHomes(response.data.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  const search = async (data) => {
    return await AxiosAuth.post(
      Config.API + "/custom/homes/search",
      data,
      undefined
    );
  };

  return (
    <div>
      <h1>Home List</h1>
      <ul>
        {homes.map((home) => (
          <li key={home.id}>
            <p>City: {home.city}</p>
            <p>Country: {home.country}</p>
            <p>Zip Code: {home.zipCode}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HomeList;
